    import React, { useState } from "react";
    import {
    Box,
    Flex,
    Text,
    Stack,
    useColorMode,
    } from "@chakra-ui/react";
    // icons
    import { BiMenu } from "react-icons/bi";
    import { AiOutlineClose } from "react-icons/ai";
    import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

    import { faCoffee } from '@fortawesome/free-solid-svg-icons'

    // import { NavHashLink } from "react-router-hash-link";

    function Navbar(props) {
    // eslint-disable-next-line
    const { colorMode, toggleColorMode } = useColorMode();
    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return (
        <NavBarContainer {...props}>
        <a href="/">
            <Text as="h1" fontWeight="500" fontSize="4xl">
            Logo
            </Text>
        </a>

        <MenuToggle toggle={toggle} isOpen={isOpen} />
        <MenuLinks isOpen={isOpen} />
        <IconComponent />
        </NavBarContainer>
    );
    }

    const MenuToggle = ({ toggle, isOpen }) => {
    return (
        <Box display={{ base: "block", md: "none" }} onClick={toggle}>
        {isOpen ? <AiOutlineClose size={40} /> : <BiMenu size={40} />}
        </Box>
    );
    };

    const MenuLinks = ({ isOpen }) => {
    return (
        <Box
        display={{ base: isOpen ? "block" : "none", md: "block" }}
        flexBasis={{ base: "100%", md: "auto" }}
        >
        <Stack
            spacing={8}
            align="flex-end"
            justify={["center", "space-around", "flex-end", "center"]}
            direction={["column", "row", "row", "row"]}
            pt={[4, 4, 0, 0]}
        >
            <a href="/">
            <Text display="block" fontWeight="700">
                Home
            </Text>
            </a>

            <a href="/#Products">
            <Text display="block" fontWeight="700">
                Products
            </Text>
            </a>

            <a href="/#Training">
            <Text display="block" fontWeight="700">
                {/* Training and Consultation */}
                Training
            </Text>
            </a>

            <a href="/#5s-Warm-Up">
            <Text display="block" fontWeight="700">
                5s Warm Up
            </Text>
            </a>
        </Stack>
        </Box>
    );
    };

    const IconComponent = () => {
    return (
        <>
        <Box
            // display={{ base: isOpen ? "block" : "none", md: "block" }}
            flexBasis={{ base: "100%", md: "auto" }}
        >
            <Stack
            spacing={8}
            align="flex-end"
            justify={["flex-end", "space-around", "flex-end", "center"]}
            direction={["column", "row", "row", "row"]}
            pt={[4, 4, 0, 0]}
            >
            {/* <Box display={{ base: "block", md: "none" }} onClick={toggle}>
                {isOpen ? <AiOutlineClose size={40} /> : <BiMenu size={40} />}
            </Box> */}
            <FontAwesomeIcon icon=" fa-bag-shopping" />
            <Text>Hello</Text>
            </Stack>
        </Box>
        </>
    );
    };

    const NavBarContainer = ({ children, ...props }) => {
    return (
        <Flex
        as="nav"
        align="center"
        justify="space-around"
        wrap="wrap"
        w="100vw"
        p="1.25%"
        {...props}
        border="1px solid red"
        >
        {children}
        </Flex>
    );
    };

    export default Navbar;
